import React,{useSate, useEffect} from "react";
import { Card, Col, Row } from "antd";
import { EditOutlined, DeleteOutlined } from "@ant-design/icons";
import { useCounter } from "../../store/api";
import apiRequest from "../../apiRequest";
const CardView = () => {
  const { count, message, increment, decrement, reset} = useCounter();
  // apiRequest.getTripData(url).then(result => {
  //   console.log(result.data);
  //   //console.log('tripData: ',tripData);
  // })

  return (
    <div className="site-card-wrapper">
        <div>
        {count}
        <button onClick={() => increment()}>+</button>
        <button onClick={() => decrement()}>-</button>
        <button onClick={() => reset()}> Reset</button>
        {message}
      </div>
      <Row gutter={16}>
        <Col span={8}>
          <Card
            title="Card title"
            bordered={true}
            actions={[
              <EditOutlined key="edit" />,
              <DeleteOutlined key="delete" />
            ]}
          >
            <div className="trip-date">
              <b className="mr10">Date:</b>2020-03-13
            </div>
            <div className="trip-duration">
              <b className="mr10">Duration:</b>23
            </div>
            <div className="trip-commnet">
              <b className="mr10">Comments:</b>portals Future-proofed Baby
            </div>
          </Card>
        </Col>
      </Row>
    </div>
  );
};

export default CardView;
